import React from 'react'
import {NavLink} from "react-router-dom";

export const MainC = (props) => {
    return (
        <>
            <NavLink to='/game'>
                <input type="button" name='r' value='Rock' onClick={props.userStepOnClick}/>
                <input type="button" name='s' value='Scissor' onClick={props.userStepOnClick}/>
                <input type="button" name='p' value='Paper' onClick={props.userStepOnClick}/>
            </NavLink>
        </>
    )
}
